        private static readonly ConcurrentDictionary<string, FilesValue> _values =
            new ConcurrentDictionary<string, FilesValue>(_knownValues);

        private FilesValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static FilesValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new FilesValue(value));
        }

        public static implicit operator FilesValue(string value) => Of(value);
        public static implicit operator string(FilesValue filesvalue) => filesvalue.Value;

        public static FilesValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as FilesValue);

        public bool Equals(FilesValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
        }

        public override int GetHashCode() => Value.GetHashCode();
    }

